import React from "react";
import { Wrap, FlexItem, FlexItems, CountText } from "../styles/Partners";
import CountUp from "react-countup";

import VisibilitySensor from 'react-visibility-sensor';


function Partners() {
  return (
    <Wrap>
      <div className="container">
        <FlexItems>
          <FlexItem>

              <div>
                <CountUp end={200} redraw={true}>
                  {({ countUpRef, start }) => (
                    <VisibilitySensor onChange={start} delayedCall>
                      <span ref={countUpRef} />
                    </VisibilitySensor>
                  )}
                </CountUp>
                +
              </div>

            <CountText>Senior and leadership hires</CountText>
          </FlexItem>

          <FlexItem>

              <div>
                <CountUp end={17} redraw={true}>
                  {({ countUpRef, start }) => (
                    <VisibilitySensor onChange={start} delayedCall>
                      <span ref={countUpRef} />
                    </VisibilitySensor>
                  )}
                </CountUp>{" "}
                +
              </div>

            <CountText>Countries we have placed individuals</CountText>
          </FlexItem>
        </FlexItems>
      </div>
    </Wrap>
  );
}

export default Partners;
